-- SCHEMA: list

-- DROP SCHEMA IF EXISTS list ;
--Crear schema list
CREATE SCHEMA IF NOT EXISTS list
    AUTHORIZATION jeyfredc;

-- Table: list.tv_shows

-- DROP TABLE IF EXISTS list.tv_shows;

-- Crear tabla tv_shows
CREATE TABLE IF NOT EXISTS list.tv_shows
(
    id integer NOT NULL DEFAULT nextval('list.tv_shows_id_seq'::regclass),
    title character varying(255) COLLATE pg_catalog."default" NOT NULL,
    description text COLLATE pg_catalog."default" NOT NULL,
    program_type character varying(50) COLLATE pg_catalog."default" NOT NULL,
    images_url character varying(255) COLLATE pg_catalog."default" NOT NULL,
    images_width integer NOT NULL,
    images_height integer NOT NULL,
    release_year integer NOT NULL,
    CONSTRAINT tv_shows_pkey PRIMARY KEY (id)
)

TABLESPACE pg_default;

ALTER TABLE IF EXISTS list.tv_shows
    OWNER to jeyfredc;

